<script>
    import axios from "axios";

    export default {
        name: "rankingList",
        data() {
            return {
                Ranking: "",
                dataCard: [[]],
                SorttextPross: "NoWorld1",
            };
        },
        created() {
            axios
                .get("/data.json")
                .then((resp) => {
                    this.Ranking = resp.data._apiBase + "/x/web-interface/ranking/v2";
                    this.doInit();
                })
                .catch((err) => {
                    this.$Message.error("配置文件加载异常");
                    console.log(err);
                });
        },
        methods: {
            doInit() {
                axios
                    .get(this.Ranking)
                    .then((resp) => {
                        console.log("排行")
                        console.log(resp.data);
                        var arr1 = [];
                        var list = resp.data.data.list;
                        for (var i = 0; i < list.length; i++) {
                            var pro = {
                                title: list[i]["title"],
                                pic: list[i]["pic"],
                                owner: list[i]["owner"]["name"],
                                view: list[i]["stat"]["view"],
                                danmaku: list[i]["stat"]["danmaku"],
                                cover_right_content_description: this.getLocalTime(
                                    list[i]["ctime"]
                                ),
                            };
                            arr1.push(pro);
                        }
                        // this.dataCard = arr1.reduce(
                        //   (pre, next, idx) => {
                        //     const inner = pre[~~(idx / 3)];
                        //     if (inner !== undefined) {
                        //       inner.push(next);
                        //     } else {
                        //       pre.push([next]);
                        //     }
                        //     return pre;
                        //   },
                        //   [[]]
                        // );
                        this.dataCard = arr1;
                        // console.log(dataCard);
                        // for (var j = 0; j <= dataCard.length; j++) {
                        //   this.dataCard.push(dataCard[j]);
                        // }
                        this.$Loading.finish();
                    })
                    .catch((err) => {
                        this.$Message.error("初始化推荐异常");
                        console.log(err);
                    });
            },
            getLocalTime(nS) {
                // parseInt() 函数可解析一个字符串，并返回一个整数。
                // js中时间操作单位是毫秒。
                // toLocaleString() 方法可根据本地时间把 Date 对象转换为字符串，并返回结果。
                // replace() 方法用于在字符串中用一些字符替换另一些字符，或替换一个与正则表达式匹配的子串。
                // replace(/:\d{1,2}$/,' ')验证替换以：开始有一位或二位数字的结束字符串，就是秒；替换为空
                let time = new Date(parseInt(nS) * 1000)
                    .toLocaleString()
                    .replace(/:\d{1,2}$/, " ")
                    .replace(/\//g, "-");
                // 找出出现空格的位置
                let space_position = time.indexOf(" ");
                // 截取并返回数据
                return time.slice(0, space_position);
            },
        },
    };
</script>

